import React from 'react';

import './TextContainer.css';


const TextContainer = ({users}) => (
    <div>
        <h1>People currently in this room:</h1>
        <div>
            {users.map ((user) => {
                <div key="{user.name}"> {user.name}</div>
            })}
        </div>
    </div>
);


export default TextContainer;
